import React from 'react';
import './App.css';
import {LandingPageView} from "./Views/landing-page/landing-page-view";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";

function App() {
  return (

        <Router>

                <Switch>
                    <Route exact path="/manage-attributes" component={()=><h2>Manage Attributes</h2>} />
                    <Route exact path="/" component={()=><LandingPageView message={"this is the landing page"}/>} />


                </Switch>
        </Router>


  );
}

export default App;
